insert into product (id, name, description, picture, price, quantity) values (1, 'Don Quixote', 'Don Quixote, is a Spanish novel by Miguel de Cervantes Saavedra. Published in two volumes, in 1605 and 1615, Don Quixote is considered the most influential work of literature from the Spanish Golden Age and the entire Spanish literary canon.', 'data:image/jpeg;base64,', 23.96, 139);
insert into product (id, name, description, picture, price, quantity) values (2, 'The Lord of the Rings: The Fellowship of the Ring', 'The story begins in the Shire, where the hobbit Frodo Baggins inherits the Ring from Bilbo Baggins, his cousin and guardian.', 'data:image/gif;base64,', 41.90, 144);
insert into product (id, name, description, picture, price, quantity) values (3, 'The Lord of the Rings: The Two Towers', 'Orcs sent by Saruman and Sauron kill Boromir and take Merry and Pippin. Aragorn, Gimli and Legolas debate amongst themselves which pair of hobbits to follow.', 'data:image/gif;base64,', 45.99, 123);
insert into product (id, name, description, picture, price, quantity) values (4, 'The Lord of the Rings: The Return of the King', 'Sauron sends a great army against Gondor. Gandalf arrives at Minas Tirith to warn Denethor of the attack, while Thoden musters the Rohirrim to ride to Gondor''s aid.', 'data:image/gif;base64,', 49.14, 173);
insert into product (id, name, description, picture, price, quantity) values (5, 'The Little Prince', 'The Little Prince, first published in 1943, is a novel, the most famous work of French aristocrat, writer, poet, and pioneering aviator Antoine de Saint-Exupry.', 'data:image/jpeg;base64,', 17.73, 165);
insert into product (id, name, description, picture, price, quantity) values (6, 'Harry Potter and the Philosopher''s Stone', 'Eleven-year-old Harry Potter has been living an ordinary life, constantly abused by his surly and cold uncle and aunt, Vernon and Petunia Dursley and bullied by their spoiled bully of a son Dudley.', 'data:image/jpeg;base64,', 32.26, 199);
insert into product (id, name, description, picture, price, quantity) values (7, 'Harry Potter and the Chamber of Secrets', 'On Harry Potter''s birthday in 1992, the Dursley family  Harry''s Uncle Vernon, Aunt Petunia, and cousin Dudley  hold a dinner party for a potential client of Vernon''s drill-manufacturing company.', 'data:image/jpeg;base64,', 28.43, 148);
insert into product (id, name, description, picture, price, quantity) values (8, 'Harry Potter and the Prisoner of Azkaban', 'Harry is back at the Dursleys, where he sees on Muggle television that a prisoner named Sirius Black has escaped. Harry involuntarily inflates Aunt Marge when she comes to visit after she insults Harry and his parents.', 'data:image/jpeg;base64,', 48.38, 107);
insert into product (id, name, description, picture, price, quantity) values (9, 'Harry Potter and the Goblet of Fire', 'The book opens with Harry seeing Frank Bryce being killed by Lord Voldemort in a vision, and is awoken by his scar hurting. The Weasleys then take Harry and Hermione Granger to the Quidditch World Cup, using a Portkey, to watch Ireland versus Bulgaria, with Ireland emerging victorious.', 'data:image/jpeg;base64,', 25.47, 142);
insert into product (id, name, description, picture, price, quantity) values (10, 'Harry Potter and the Order of the Phoenix', 'During another summer with his Aunt Petunia and Uncle Vernon, Harry Potter and Dudley are attacked by Dementors. After using magic to save Dudley and himself, Harry is expelled from Hogwarts, but the decision is later reversed after a hearing at the Ministry of Magic.', 'data:image/jpeg;base64,', 18.05, 116);
insert into product (id, name, description, picture, price, quantity) values (11, 'Harry Potter and the Half-Blood Prince', 'Severus Snape, a member of the Order of the Phoenix, meets with Narcissa Malfoy, Draco''s mother, and Lord Voldemort''s faithful supporter Bellatrix Lestrange. Narcissa expresses concern that her son might not survive a dangerous mission given to him by Lord Voldemort.', 'data:image/jpeg;base64,', 49.22, 133);
insert into product (id, name, description, picture, price, quantity) values (12, 'Harry Potter and the Deathly Hallows', 'Following Dumbledore''s death, Voldemort consolidates his support and power, including covert control of the Ministry of Magic, while Harry is about to turn seventeen, losing the protection of his home. The Order of the Phoenix move Harry to a new location before his birthday, but are attacked upon departure. In the ensuing battle, "Mad-Eye" Moody is killed and George Weasley wounded;', 'data:image/jpeg;base64,', 19.09, 145);
insert into product (id, name, description, picture, price, quantity) values (13, 'And Then There Were None', 'On a hot, early August day sometime in the late 1930s, eight people arrive on a small, isolated island off the Devon coast of England. Each appears to have an invitation tailored to his or her personal circumstances, such as an offer of employment or an unexpected late summer holiday.', 'data:image/jpeg;base64,', 49.75, 100);
insert into product (id, name, description, picture, price, quantity) values (14, 'Alice''s Adventures in Wonderland', 'Alice is feeling bored and drowsy while sitting on the riverbank with her elder sister. She then notices a talking, clothed White Rabbit with a pocket watch run past. She follows it down a rabbit hole when suddenly she falls a long way to a curious hall with many locked doors of all sizes.', 'data:image/jpeg;base64,', 24.49, 109);
insert into product (id, name, description, picture, price, quantity) values (15, 'The Little Prince', 'Now an adult himself, the narrator has become a pilot, and, one day, his plane crashes in the Sahara, far from civilization. Here, the narrator is greeted by a young boy whom he refers to as "the little prince". Upon encountering the narrator, the little prince asks him to draw a sheep.', 'data:image/jpeg;base64,', 47.99, 133);
insert into product (id, name, description, picture, price, quantity) values (16, 'The Dark Tower: The Gunslinger', 'As Roland travels across the desert in search of the man in black whom he knows as Walter, he encounters a farmer named Brown, and Zoltan, his black crow. Roland spends the night there, and recalls his time spent in Tull, a small town which Roland passed through not long before the start of the novel.', 'data:image/jpeg;base64,', 49.92, 102);
insert into product (id, name, description, picture, price, quantity) values (17, 'The Dark Tower II: The Drawing of the Three', 'The book begins less than seven hours after the end of The Dark Tower: The Gunslinger after The Man in Black has described The Gunslinger''s fate using tarot cards.', 'data:image/jpeg;base64,', 44.30, 197);
insert into product (id, name, description, picture, price, quantity) values (18, 'The Dark Tower III: The Waste Lands', 'The story begins five weeks after the end of The Drawing of the Three. Roland, Susannah, and Eddie have moved east from the shore of the Western Sea, and into the woods of Out-World.', 'data:image/jpeg;base64,', 34.05, 114);
insert into product (id, name, description, picture, price, quantity) values (19, 'The Dark Tower IV: Wizard and Glass', 'The novel begins where The Waste Lands ended. After Jake, Eddie, Susannah and Roland fruitlessly riddle Blaine the Mono for several hours, Eddie defeats the mad computer by telling childish jokes.', 'data:image/jpeg;base64,', 41.77, 126);
insert into product (id, name, description, picture, price, quantity) values (20, 'The Dark Tower: The Wind Through the Keyhole', 'The novel begins with Roland and his ka-tet arriving at a river on their journey to the Dark Tower. An elderly man who operates a ferry gets them across the river, and warns them that a severe depression (starkblast) is coming, and that they can find shelter in a building a few miles ahead.', 'data:image/jpeg;base64,', 49.22, 130);
insert into product (id, name, description, picture, price, quantity) values (21, 'The Dark Tower V: Wolves of the Calla', 'After escaping the alternate Topeka and the evil wizard Walter O''Dim and weathering the starkblast, Roland''s ka-tet begin to sense they are being followed in their travels.', 'data:image/jpeg;base64,', 15.13, 186);
insert into product (id, name, description, picture, price, quantity) values (22, 'The Dark Tower VI: Song of Susannah', 'Taking place mainly in our world (New York City and East Stoneham, Maine), this book picks up where Wolves of the Calla left off, with the ka-tet employing the help of the Manni to open the magic door inside Doorway Cave.', 'data:image/jpeg;base64,', 40.95, 196);
insert into product (id, name, description, picture, price, quantity) values (23, 'The Dark Tower VII: The Dark Tower', 'Beginning where book six left off, Jake Chambers and Father Callahan battle the evil infestation within the Dixie Pig, a vampire lounge in New York City featuring roast human flesh and doors to other worlds.', 'data:image/jpeg;base64,', 17.84, 110);
